("Here's a Java solution to the problem:

```
class Solution {
    public boolean isPowerOfThree(int n) {
        if (n <= 0) {
            return false;
        }
        int x = 0;
        while (n % 3 == 0) {
            x++;
            n /= 3;
        }
        return n == 3 * x;
    }
}
```

The solution uses a while loop to iterate until n is a multiple of 3. We keep track of the number of times we've iterated (in the form of a variable x) and check if n is equal to 3 * x at the end. If it is, we return true; otherwise, we continue to the next value of n.", False)

